// src/components/Header.js
import React from 'react';
import SteamLogo from './SteamLogo';
import './Header.css';

const Header = () => {
  return (
    <header>
      <h1>게임 목록</h1>
      <nav>
        <ul className="social-icons">
          <li>
            <SteamLogo />
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Header;
